function changepdb()
{
  var key = grab("pdbpreset").value;
  if ( key !== "user" ) {
    grab("strpdb").value = preset_pdb[ key ];
  }
}

window.onload = changepdb;



function getparams()
{
  strpdb = grab("strpdb").value;
  tp = get_float("temperature", 300.0);
  simulmethod = grab("simulmethod").value;

  kb = get_float("kb", 200.0);
  ka = get_float("ka", 40.0);
  kd1 = get_float("kd1", 1.0);
  kd3 = get_float("kd3", 0.5);
  nbe = get_float("nbe", 1.0);
  nbc = get_float("nbc", 4.0);
  rc = get_float("rc", 5.0);
  contact_type = grab("contact_type").value;

  mddt = get_float("mddt", 0.002);
  thdt = get_float("thermostatdt", 0.01);
  nstepspsmd = get_int("nstepspersecmd", 1000);
  nstepspfmd = nstepspsmd * timer_interval / 1000;

  mcamp = get_float("mcamp", 0.2);
  nstepspsmc = get_int("nstepspersecmc", 10000);
  nstepspfmc = nstepspsmc * timer_interval / 1000;

  mousescale = get_float("goscale");
}



function changescale()
{
  mousescale = get_float("goscale");
  paint();
}



function getsinfo()
{
  var s = "";
  s += '<span class="math"><i>U</i></span>: ' + roundto(sumU/sum1, 3) + ", ";
  s += 'RMSD: ' + roundto(sumR/sum1, 3) + "&#8491;, ";
  s += 'Contacts: ' + roundto(sumC/sum1, 2) + "/" + roundto(go.ncont, 2) + ".";
  return s;
}



function domd()
{
  var istep, sinfo = "";

  for ( istep = 0; istep < nstepspfmd; istep++ ) {
    go.vv(1.0, mddt);
    go.vrescale(go.v, tp, thdt);
    sum1 += 1.0;
    sumU += go.epot;
    sumR += go.getRMSD(go.x, null);
    sumC += go.ncontacts(go.x);
  }
  sinfo += getsinfo();
  return sinfo;
}



function domc()
{
  var istep, sinfo = "";

  for ( istep = 0; istep < nstepspfmc; istep++ ) {
    mctot += 1.0;
    mcacc += go.metro(mcamp, 1.0 / tp);
    sum1 += 1.0;
    sumU += go.epot;
    sumR += go.getRMSD(go.x, null);
    sumC += go.ncontacts(go.x);
  }
  sinfo += "acc: " + roundto(100.0 * mcacc / mctot, 2) + "%, ";
  sinfo += getsinfo();
  return sinfo;
}



function paint()
{
  if ( go ) {
    var ballscale = get_float("ballscale", 1.0);
    var drawref = grab("drawref").checked;
    if ( drawref ) { // draw the reference structure
      cagodraw(go, go.xref, "gobox", mousescale, ballscale, false, true);
    }
    // we draw go.x1 instead of go.x, because the former
    // has been fit against the native structure
    cagodraw(go, go.x1, "gobox", mousescale, ballscale, drawref, false);
  }
}



function pulse()
{
  var sinfo;

  if ( simulmethod === "MD" ) {
    sinfo = domd();
  } else if ( simulmethod === "MC" ) {
    sinfo = domc();
  }
  go.getRMSD(go.x, go.x1);
  grab("sinfo").innerHTML = sinfo;

  paint();
}



function stopsimul()
{
  if ( cagotimer !== null ) {
    clearInterval(cagotimer);
    cagotimer = null;
  }
  mctot = 0.0;
  mcacc = 0.0;
  sum1 = 1e-30;
  sumU = 0.0;
  sumR = 0.0;
  sumC = 0.0;
  munit(viewmat);
}



function pausesimul()
{
  if ( !go ) {
    return;
  }
  if ( cagotimer !== null ) {
    clearInterval(cagotimer);
    cagotimer = null;
    grab("pause").value = "Resume";
  } else {
    cagotimer = setInterval(
        function() { pulse(); },
        timer_interval);
    grab("pause").value = "Pause";
  }
}



function fmtseq( iaa, w )
{
  var s = "";

  for ( var i = 0; i < iaa.length; i++ ) {
    s += "<span class style='background-color: "
       + lightenColor( aacolors[ iaa[i] ], 0.7 )
       + "'><sub>&nbsp;</sub>"
       + aaletters[ iaa[i] ] + "<sub> </sub></span>";
  }
  return s;
}



function startsimul()
{
  stopsimul();
  changepdb();
  getparams();
  go = new CaGo(strpdb, kb, ka, kd1, kd3, nbe, nbc,
      rc, contact_type, nsexcl);
  grab("seq").innerHTML = fmtseq( go.iaa, 60 );
  go.initmd(false, 0.01, tp);
  go.epot = go.force(go.x, go.f);
  installmouse("gobox", "goscale");
  cagotimer = setInterval(
    function(){ pulse(); },
    timer_interval);
}



/* respond to critical parameter changes: restart simulation */
function changeparams()
{
  changepdb();

  if ( cagotimer !== null ) {
    startsimul();
  }
}

